import { useState } from 'react';
import './TemperatureControl.css';

export default function TemperatureSlider() {
  const [temperature, setTemperature] = useState(1); // Initial temperature value

  const handleSliderChange = (event) => {
    setTemperature(event.target.value);
  };

  const handleInputChange = (event) => {
    setTemperature(event.target.value);
  };

  return (
    <div className="flex flex-col">
      <p className="text-left text-sm">Temperature</p>
      <div className="items-center">
        <input
          type="number"
          min="0"
          max="2"
          step="0.01"
          value={temperature}
          onChange={handleInputChange}
          className="w-10 h-5 rounded-sm text-center appearance-none cursor-pointer focus:outline-none no-arrows"
          style={{ textAlign: 'center' }}
        />
        <input
          type="range"
          min="0"
          max="2"
          step="0.01"
          value={temperature}
          onChange={handleSliderChange}
          className="block ml-2 mb-2 text-sm font-medium text-gray-900 dark:text-white"
        />
      </div>
    </div>


  );
}
